        [Test]
        public void Image_Reduced_To_Width()
        {
            //Arrange
            ImageResizer imageResizer = new ImageResizer();
            Image image = SampleImage();

            //Act
            Image resizedImage = imageResizer.ResizeImage(image, 300, 500);

            //Assert
            Assert.That(resizedImage.Width, Is.EqualTo(300));
        }

